(clojure.core/defn update-custom-key-store "Changes the properties of a custom key store. Use the CustomKeyStoreId parameter\nto identify the custom key store you want to edit. Use the remaining parameters\nto change the properties of the custom key store.\n You can only update a custom key store that is disconnected. To disconnect the\ncustom key store, use DisconnectCustomKeyStore. To reconnect the custom key\nstore after the update completes, use ConnectCustomKeyStore. To find the\nconnection state of a custom key store, use the DescribeCustomKeyStores\noperation.\n Use the NewCustomKeyStoreName parameter to change the friendly name of the\ncustom key store to the value that you specify.\n Use the KeyStorePassword parameter tell AWS KMS the current password of the\nkmsuser crypto user (CU)\n(http://docs.aws.amazon.com/kms/latest/developerguide/key-store-concepts.html#concept-kmsuser)\nin the associated AWS CloudHSM cluster. You can use this parameter to fix\nconnection failures that occur when AWS KMS cannot log into the associated\ncluster because the kmsuser password has changed. This value does not change the\npassword in the AWS CloudHSM cluster.\n Use the CloudHsmClusterId parameter to associate the custom key store with a\nrelated AWS CloudHSM cluster, that is, a cluster that shares a backup history\nwith the original cluster. You can use this parameter to repair a custom key\nstore if its AWS CloudHSM cluster becomes corrupted or is deleted, or when you\nneed to create or restore a cluster from a backup.\n The cluster ID must identify a AWS CloudHSM cluster with the following\nrequirements.\n * The cluster must be active and be in the same AWS account and Region as the\ncustom key store.\n * The cluster must have the same cluster certificate as the original cluster.\nYou cannot use this parameter to associate the custom key store with an\nunrelated cluster. To view the cluster certificate, use the AWS CloudHSM\nDescribeClusters\n(http://docs.aws.amazon.com