(clojure.core/defn delete-custom-key-store "Deletes a custom key store\n(http://docs.aws.amazon.com/kms/latest/developerguide/key-store-overview.html).\nThis operation does not delete the AWS CloudHSM cluster that is associated with\nthe custom key store, or affect any users or keys in the cluster.\n The custom key store that you delete cannot contain any AWS KMS customer master\nkeys (CMKs)\n(http://docs.aws.amazon.com/kms/latest/developerguide/concepts.html#master_keys).\nBefore deleting the key store, verify that you will never need to use any of the\nCMKs in the key store for any cryptographic operations. Then, use\nScheduleKeyDeletion to delete the AWS KMS customer master keys (CMKs) from the\nkey store. When the scheduled waiting period expires, the ScheduleKeyDeletion\noperation deletes the CMKs. Then it makes a best effort to delete the key\nmaterial from the associated cluster. However, you might need to manually delete\nthe orphaned key material\n(http://docs.aws.amazon.com/kms/latest/developerguide/fix-keystore.html#fix-keystore-orphaned-key)\nfrom the cluster and its backups.\n After all CMKs are deleted from AWS KMS, use DisconnectCustomKeyStore to\ndisconnect the key store from AWS KMS. Then, you can delete the custom key\nstore.\n Instead of deleting the custom key store, consider using\nDisconnectCustomKeyStore to disconnect it from AWS KMS. While the key store is\ndisconnected, you cannot create or use the CMKs in the key store. But, you do\nnot need to delete CMKs and you can reconnect a disconnected custom key store at\nany time.\n If the operation succeeds, it returns a JSON object with no properties.\n This operation is part of the Custom Key Store feature\n(http://docs.aws.amazon.com/kms/latest/developerguide/custom-key-store-overview.html)\nfeature in AWS KMS, which combines the convenience and extensive integration of\nAWS KMS with the isolation and control of a single-tenant key store." ([delete-custom-key-store-requestinput] (clojure.core/l