(clojure.core/defn create-custom-key-store "Creates a custom key store\n(http://docs.aws.amazon.com/kms/latest/developerguide/key-store-overview.html)\nthat is associated with an AWS CloudHSM cluster\n(http://docs.aws.amazon.com/cloudhsm/latest/userguide/clusters.html) that you\nown and manage.\n This operation is part of the Custom Key Store feature\n(http://docs.aws.amazon.com/kms/latest/developerguide/custom-key-store-overview.html)\nfeature in AWS KMS, which combines the convenience and extensive integration of\nAWS KMS with the isolation and control of a single-tenant key store.\n When the operation completes successfully, it returns the ID of the new custom\nkey store. Before you can use your new custom key store, you need to use the\nConnectCustomKeyStore operation to connect the new key store to its AWS CloudHSM\ncluster.\n The CreateCustomKeyStore operation requires the following elements.\n * You must specify an active AWS CloudHSM cluster in the same account and AWS\nRegion as the custom key store. You can use an existing cluster or create and\nactivate a new AWS CloudHSM cluster\n(http://docs.aws.amazon.com/cloudhsm/latest/userguide/create-cluster.html) for\nthe key store. AWS KMS does not require exclusive use of the cluster.\n * You must include the content of the trust anchor certificate for the cluster.\nYou created this certificate, and saved it in the customerCA.crt file, when you\ninitialized the cluster\n(http://docs.aws.amazon.com/cloudhsm/latest/userguide/initialize-cluster.html#sign-csr).\n * You must provide the password of the dedicated kmsuser crypto user\n(http://docs.aws.amazon.com/kms/latest/developerguide/key-store-concepts.html#concept-kmsuser)\n(CU) account in the cluster.\n Before you create the custom key store, use the createUser\n(http://docs.aws.amazon.com/cloudhsm/latest/userguide/cloudhsm_mgmt_util-createUser.html)\ncommand in cloudhsm_mgmt_util to create a crypto user (CU) named kmsuser\n(http://docs.aws.amazon.com/kms/latest/