de/fix-keystore.html) in the\nAWS KMS Developer Guide." ([create-custom-key-store-requestinput] (clojure.core/let [request-function-result__22119__auto__ (req-create-custom-key-store-request create-custom-key-store-requestinput)] (portkey.aws/-call-http (clojure.core/into request-function-result__22119__auto__ {:http.request.configuration/endpoints portkey.aws.kms.-2014-11-01/endpoints, :http.request.configuration/target-prefix "TrentService", :http.request.spec/output-spec :portkey.aws.kms.-2014-11-01/create-custom-key-store-response, :http.request.configuration/mime-type {"content-type" "application/x-amz-json-1.1"}, :http.request.configuration/request-uri "/", :http.request.configuration/version "2014-11-01", :http.request.configuration/service-id "KMS", :http.request.spec/input-spec :portkey.aws.kms.-2014-11-01/create-custom-key-store-request, :http.request.configuration/protocol "json", :http.request.configuration/method :post, :http.request.configuration/response-code nil, :http.request.configuration/result-wrapper nil, :http.request.configuration/action "CreateCustomKeyStore", :http.request.configuration/output-deser-fn response-create-custom-key-store-response, :http.request.spec/error-spec {"CloudHsmClusterInUseException" :portkey.aws.kms.-2014-11-01/cloud-hsm-cluster-in-use-exception, "CustomKeyStoreNameInUseException" :portkey.aws.kms.-2014-11-01/custom-key-store-name-in-use-exception, "CloudHsmClusterNotFoundException" :portkey.aws.kms.-2014-11-01/cloud-hsm-cluster-not-found-exception, "KMSInternalException" :portkey.aws.kms.-2014-11-01/kms-internal-exception, "CloudHsmClusterNotActiveException" :portkey.aws.kms.-2014-11-01/cloud-hsm-cluster-not-active-exception, "IncorrectTrustAnchorException" :portkey.aws.kms.-2014-11-01/incorrect-trust-anchor-exception, "CloudHsmClusterInvalidConfigurationException" :portkey.aws.kms.-2014-11-01/cloud-hsm-cluster-invalid-configuration-exception}})))))
