CMK. For details,\nsee How Key State Affects Use of a Customer Master Key\n(http://docs.aws.amazon.com/kms/latest/developerguide/key-state.html) in the AWS\nKey Management Service Developer Guide." ([import-key-material-requestinput] (clojure.core/let [request-function-result__22119__auto__ (req-import-key-material-request import-key-material-requestinput)] (portkey.aws/-call-http (clojure.core/into request-function-result__22119__auto__ {:http.request.configuration/endpoints portkey.aws.kms.-2014-11-01/endpoints, :http.request.configuration/target-prefix "TrentService", :http.request.spec/output-spec :portkey.aws.kms.-2014-11-01/import-key-material-response, :http.request.configuration/mime-type {"content-type" "application/x-amz-json-1.1"}, :http.request.configuration/request-uri "/", :http.request.configuration/version "2014-11-01", :http.request.configuration/service-id "KMS", :http.request.spec/input-spec :portkey.aws.kms.-2014-11-01/import-key-material-request, :http.request.configuration/protocol "json", :http.request.configuration/method :post, :http.request.configuration/response-code nil, :http.request.configuration/result-wrapper nil, :http.request.configuration/action "ImportKeyMaterial", :http.request.configuration/output-deser-fn response-import-key-material-response, :http.request.spec/error-spec {"InvalidImportTokenException" :portkey.aws.kms.-2014-11-01/invalid-import-token-exception, "InvalidCiphertextException" :portkey.aws.kms.-2014-11-01/invalid-ciphertext-exception, "DependencyTimeoutException" :portkey.aws.kms.-2014-11-01/dependency-timeout-exception, "KMSInvalidStateException" :portkey.aws.kms.-2014-11-01/kms-invalid-state-exception, "InvalidArnException" :portkey.aws.kms.-2014-11-01/invalid-arn-exception, "UnsupportedOperationException" :portkey.aws.kms.-2014-11-01/unsupported-operation-exception, "NotFoundException" :portkey.aws.kms.-2014-11-01/not-found-exception, "KMSInternalException" :portkey.aws.kms.-2014-11-01/kms-internal-exception, 